import { Link } from 'react-router-dom';


export default function Card({ fullname,title, id,imageUrl}) {
  return (
    <div>
      <Link to = {'/details/'+ id}>
        <h3>{fullname}</h3>
        <h5>{title}</h5>
       <img src= {imageUrl}  alt="img not found"/>
       </Link> 
    </div>
  );
}
